DELIMITER $$
CREATE TRIGGER `CapNhatTrangThaiPhim` BEFORE UPDATE ON `Phim` FOR EACH ROW BEGIN
    DECLARE ngay_hien_tai DATE;
    SET ngay_hien_tai = CURDATE();

    -- Kiểm tra xem TrangThai của hàng dữ liệu mới có là NULL hay không
    IF NEW.TrangThai IS NULL THEN
        -- Kiểm tra NgayPhatHanh so với ngày hiện tại
        IF NEW.NgayPhatHanh > ngay_hien_tai THEN
            -- Đặt TrangThai là 2 nếu NgayPhatHanh sau ngày hiện tại
            SET NEW.TrangThai = 2;
        ELSE
            -- Đặt TrangThai là 1 nếu NgayPhatHanh trước hoặc đúng ngày hiện tại
            SET NEW.TrangThai = 1;
        END IF;
    END IF;
END
$$
DELIMITER ;

