DELIMITER $$
CREATE TRIGGER `update_ve_gia_khi_cap_nhat_hoa_don` BEFORE UPDATE ON `Ve` FOR EACH ROW BEGIN
    DECLARE loai_ve_gia INT;
        DECLARE loai_ghe_gia INT;
        DECLARE suat_chieu_gia INT;
    IF NEW.TrangThai <> OLD.TrangThai AND NEW.TrangThai = 5 THEN
    

        -- Lấy giá vé từ bảng LoaiVe
        SELECT GiaVe
        INTO loai_ve_gia
        FROM LoaiVe
        WHERE MaLoaiVe = NEW.MaLoaiVe;

        -- Lấy giá ghế từ bảng Ghe và LoaiGhe
        SELECT lg.GiaVe
        INTO loai_ghe_gia
        FROM Ghe g
        JOIN LoaiGhe lg ON g.MaLoaiGhe = lg.MaLoaiGhe
        WHERE g.MaGhe = NEW.MaGhe;

        -- Lấy giá vé từ bảng SuatChieu
        SELECT GiaVe
        INTO suat_chieu_gia
        FROM SuatChieu
        WHERE MaXuatChieu = NEW.MaSuatChieu;

        -- Tính tổng giá vé
        SET NEW.GiaVe = loai_ve_gia + loai_ghe_gia + suat_chieu_gia;
    END IF;
END
$$
DELIMITER ;

