INSERT INTO `Phim` (`MaPhim`, `TenPhim`, `NgayPhatHanh`, `HanCheDoTuoi`, `HinhAnh`, `ThoiLuong`, `NgonNgu`, `MoTa`, `DaoDien`, `TrangThai`, `DinhDang`, `Trailer`) VALUES
(127, 'HÀNH TINH CÁT PHẦN 2 (T16)', '2024-02-28', 'T16', 'https://cinestar.com.vn/pictures/Cinestar/03-2024/hanh-tinh-cat-2.jpg', 180, 'VN', '“Dune: Hành Tinh Cát – Phần 2” sẽ tiếp tục khám phá hành trình đậm chất thần thoại của Paul Atreides khi anh đồng hành cùng Chani và những người Fremen trên chặng đường trả thù những kẻ đã hủy hoại gia đình mình. Đối mặt với những lựa chọn giữa tình yêu của cuộc đời mình và số phận của vũ trụ, Paul phải ngăn chặn viễn cảnh tương lai tồi tệ chỉ mình anh nhìn thấy.', 'Denis Villeneuve', 3, '2D', 'https://www.youtube.com/watch?v=0ZqTYVYcx4k'),
(128, 'KUNG FU PANDA 4 2D PĐ (P)', '2024-03-04', 'P', 'https://cinestar.com.vn/pictures/Cinestar/03-2024/kungfu-panda-4-poster.jpg', 94, 'Phụ Đề', 'Po sau khi chiến đấu với Kai, kẻ phản diện gây nỗi khiếp sợ cho mọi người trong phần 3, trong phần 4 này cậu \"sẽ đối diện với thử thách lớn nhất của mình. Nhưng liệu cậu ta có sống sót qua thử thách ấy hay không?\".', 'Stephanie Stine, Mike Mitchell', 1, '2D', 'https://www.youtube.com/watch?v=_UWBj1-_V5M'),
(130, 'SÁNG ĐÈN (K)', '2024-03-21', 'K', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/sang-den-poster.jpg', 140, 'VN', 'Sau 2 phim Tết thuộc thể loại kinh dị thì năm nay đạo diễn Hoàng Tuấn Cường bất ngờ chuyển hướng với SÁNG ĐÈN. Bộ phim xoay quanh câu chuyện về thời thịnh suy, giao thời của cải lương và những gánh hát lưu diễn khắp miền tây.', 'NSND Hồng Vân, NSND Lê Thiện, Cao Minh Ðạt, Bạch Công Khanh,...', 1, '2D', 'https://www.youtube.com/watch?v=U1OL29k4kRQ'),
(131, 'QUÝ CÔ THỪA KẾ 2 (T16)', '2024-03-05', 'T16', 'https://cinestar.com.vn/pictures/Cinestar/03-2024/quy-co-thua-ke.jpg', 125, 'VN', '“Quý cô thừa kế 2” xoay quanh cuộc sống của một tiểu thư thuộc giới thượng lưu được nuông chiều đã trải qua nhiều thăng trầm trong cuộc sống. Phim kể về gia đình tưởng chừng như đầm ấm và hạnh phúc của Cao Minh, Hải Đường và con gái Kim. Tuy nhiên, mọi thứ ngày càng trở nên kỳ lạ khi Cao Minh càng lúc càng thô bạo và có xu hướng kiểm soát đầy độc hại lên cả vợ và con gái mình. Trong khi đó, Kim cũng bất mãn và nổi loạn nhiều hơn, thậm chí chống đối lại cha mẹ mình vì họ không đáp ứng được yêu cầ', 'Hoàng Duy', 1, '2D', 'https://www.youtube.com/watch?v=u87V-nTMH9k'),
(132, 'ĐÀO, PHỞ VÀ PIANO (T13)', '2024-02-21', 'T13', 'https://cinestar.com.vn/pictures/Cinestar/11-2023/dao-pho-va-piano.jpg', 115, 'VN', 'Đào, Phở và Piano lấy bối cảnh trận chiến đông xuân kéo dài 60 ngày đêm từ cuối năm 1946 đến đầu năm 1947 ở Hà Nội. Câu chuyện theo chân chàng dân quân Văn Dân (Doãn Quốc Đam đóng) và chuyện tình với nàng tiểu thư đam mê dương cầm Thục Hương (Cao Thị Thùy Linh thủ vai).', 'Phi Tiến Sơn', 3, '2D', 'https://www.youtube.com/watch?v=a51mW6q0jPQ'),
(133, 'GẶP LẠI CHỊ BẦU (T13)', '2024-01-30', 'T13', 'https://cinestar.com.vn/pictures/Cinestar/02-2024/gap-lai-chi-bau-tet.jpg', 130, 'VN', 'Gặp Lại Chị Bầu\" xoay quanh Phúc, một thanh viên trẻ với đam mê diễn xuất nhưng phải trải qua cuộc sống muôn vàn khó khăn. Anh tình cờ lưu lạc đến xóm trọ của bà Lê và cùng những người bạn ở đây trải qua những ngày tháng thanh xuân đáng nhớ nhất cuộc đời.', 'Đoàn Nhất Trung', 3, '2D', 'https://www.youtube.com/watch?v=qcEbhDmNgCs'),
(134, 'MAI (T18)', '2024-01-31', 'T18', 'https://cinestar.com.vn/pictures/Cinestar/02-2024/poster-mai.jpg', 145, 'VN', '\"Mai\" xoay quanh cuộc đời của một người phụ nữ đẹp tên Mai (do Phương Anh Đào thủ vai) có số phận rất đặc biệt. Bởi làm nghề mát xa, Mai thường phải đối mặt với ánh nhìn soi mói, phán xét từ những người xung quanh. Và rồi Mai gặp Dương (Tuấn Trần) - chàng trai đào hoa lãng tử. Những tưởng bản thân không còn thiết tha yêu đương và mưu cầu hạnh phúc cho riêng mình thì khao khát được sống một cuộc đời mới trong Mai trỗi dậy khi Dương tấn công cô không khoan nhượng. Họ cho mình những khoảnh khắc tự ', 'Trấn Thành', 3, '2D', 'https://www.youtube.com/watch?v=J5TOmJ7nrRo'),
(135, 'THANH GƯƠM DIỆT QUỶ: PHÉP MÀU TÌNH THÂN, CHO ĐẾN CHUYẾN ĐẶC HUẤN CỦA ĐẠI TRỤ', '2024-02-21', 'T16', 'https://cinestar.com.vn/pictures/Cinestar/02-2024/thanh-guom-diet-quy.jpg', 120, 'VN', 'Phim lấy bối cảnh ở làng thợ rèn, kể về hồi kết của trận ác chiến giữa Tanjiro với Thượng Huyền Tứ Hantengu, và việc Nezuko khắc chế được mặt trời. Thêm vào đó, tập đầu tiên của phần \"Đại Trụ Đặc Huấn\", mở màn cho khóa đặc huấn của các Đại Trụ cho cuộc quyết chiến với Kibutsuji Muzan', 'Haruo Sotozaki', 3, '2D', 'https://www.youtube.com/watch?v='),
(136, 'BÀ THÍM BÁO THÙ (T16)', '2024-02-27', 'T16', 'https://cinestar.com.vn/pictures/Cinestar/03-2024/ba-thim-bao-thu.jpg', 125, 'VN', 'Kẻ lừa tiền “quay xe”, cầu cứu sự trợ giúp từ chính nạn nhân mà mình đã lừa đảo! Đang chật vật vay mượn khắp nơi để tiếp tục duy trì cửa tiệm giặt ủi sau hoả hoạn, Duk Hee nhận được cú điện thoại từ Son, tự xưng là nhân viên ngân hàng với lời hứa hẹn sẽ cấp cho cô một khoản vay với lãi suất ưu đãi. Tuy nhiên, Son yêu cầu Duk Hee phải gửi trước cho anh ta một khoản tiền gọi là “phí vay mượn”. Sau khi chuyển tiền, người phụ nữ tội nghiệp mới bàng hoàng nhận ra mình vừa trở thành nạn nhân của một k', 'Park Young Ju', 3, '2D', 'https://www.youtube.com/watch?v=sBrN_vByaTw'),
(137, 'HỘI CHỨNG TUỔI THANH XUÂN - CÔ BÉ ĐEO CẶP SÁCH (T13)', '2024-02-28', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/hoi-chung-tuoi-thanh-xuan.jpg', 85, 'VN', 'Chỉ còn một tháng nữa là kết thúc học kỳ ba. Cuối cùng cũng đến ngày tốt nghiệp của Mai, bạn gái lớp trên của Azusagawa Sakuta. Khi Sakuta đang chờ Mai ở bờ biển Shichirigahama, cậu bất ngờ gặp phải một cô bé giống y hệt Mai hồi còn là diễn viên nhí trong quá khứ. Mặt khác, mẹ của Sakuta, người đã bỏ rơi hai anh em Sakuta va Kanade, bất ngờ liên lạc, nói rằng muốn gặp lại họ.', '', 1, '2D', 'https://www.youtube.com/watch?v='),
(138, 'THỢ SĂN THÀNH PHỐ: SIÊU CHẤT THIÊN THẦN (T18)', '2024-02-28', 'T18', 'https://cinestar.com.vn/pictures/Cinestar/03-2024/tho-san-thanh-pho.jpg', 110, 'VN', 'Tay súng đánh thuê khét tiếng Ryo Saeba gặp phải một kẻ phản diện từng quen, anh phải chiến đấu với những con người đã biến cỗ máy nano thành siêu chiến binh, còn được gọi là Angel Dust.', 'Kenji Kodama, Kazuyoshi Takeuchi', 1, '2D', 'https://www.youtube.com/watch?v='),
(139, 'QUỶ THAY ĐẦU (T18)', '2024-02-28', 'T18', 'https://cinestar.com.vn/pictures/Cinestar/03-2024/quy-thay-dau.jpg', 110, 'VN', 'Phim theo chân Iris (Freya Allan), một cô gái trẻ bị người cha góa vợ (Peter Mullan) đối xử ghẻ lạnh. Sau khi ông qua đời, cô trở thành người thừa kế quán rượu xuống cấp đã tồn tại hàng thế kỷ ở Berlin. Bất ngờ xem được lời trăn trối của người cha qua đoạn băng video còn sót lại, Iris phát hiện một bí mật kinh hoàng về mụ ác quỷ 400 năm tuổi bị nhốt dưới tầng hầm với tên gọi Baghead. Khuôn mặt của bà ta được che giấu bởi một chiếc bao tải cũ, và có khả năng triệu hồi người chết bằng xương bằng t', 'Alberto Corredor', 1, '2D', 'https://www.youtube.com/watch?v=XXGdWuVJ3w8'),
(140, 'ĐIỆN THOẠI MA ÁM (T16)', '2024-02-29', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/cellphone.jpg', 87, 'VN', 'Wynne bị chấn thương tâm lý sau cái chết của hôn phu và cô bắt đầu nhìn thấy những hình ảnh kỳ dị báo hiệu cái chết của chính mình trong chiếc điện thoại. Lo lắng cho tính mạng, cô phải tìm hiểu xem \"Nó\" muốn nói gì?', 'Luke Sommer', 1, '2D', 'https://www.youtube.com/watch?v=-xAANyhO3Kk'),
(141, 'TIẾNG YÊU KHÔNG LỜI (T16)', '2024-03-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/tieng-yeu-khong-loi.jpg', 130, 'VN', 'Khi bỏ lỡ đi thứ tình yêu mình khao khát nhất, lại khiến người ta một đời day dứt vấn vương. Chuyện tình đơn phương lặng lẽ nhất màn ảnh không cầu kì sến súa, không lời trăng hoa đường mật, cũng không có lời hứa hay những cái ôm. Chỉ đơn giản là tình yêu chân thành từ một phía nhưng chẳng đủ can đảm nói nên lời.', 'Eiji Uchida', 1, '2D', 'https://www.youtube.com/watch?v='),
(142, 'QUẬT MỘ TRÙNG MA (T16)', '2024-03-14', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/quat-mo-trung-ma.jpg', 150, 'Phụ Đề', 'Hai pháp sư, một thầy phong thuỷ và một chuyên gia khâm liệm cùng hợp lực khai quật ngôi mộ bị nguyền rủa của một gia đình giàu có, nhằm cứu lấy sinh mạng hậu duệ cuối cùng trong dòng tộc. Bí mật hắc ám của tổ tiên được đánh thức.', 'Jang Jae Hyun', 1, '2D', 'https://www.youtube.com/watch?v=5-oRO4rYNQ4'),
(143, 'ĐỀN MẠNG (T16)', '2024-03-21', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/den-mang.jpg', 93, 'VN', 'Người cha quá cố đã phản bội lời thề khiến cho hồn ma Nang Rum nổi giận, quyết trả báo ứng lên người August bắt cầu đền mạng để chuộc tội . August sẽ tìm ra được lời thề để hóa giải lỗi lầm hay phải trả giá bằng tính mạng của bản thân?', 'Ekachai Sriwichai', 1, '2D', 'https://www.youtube.com/watch?v='),
(144, 'MUÔN VỊ NHÂN GIAN', '2024-03-21', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/muon-vi-nhan-gian.jpg', 99, 'VN', 'Phim điện ảnh Muôn Vị Nhân Gian lấy bối cảnh tại một vùng quê nước Pháp năm 1885, xoay quanh mối tình lãng mạn giữa nữ đầu bếp Eugénie (Juliette Binoche) và Dodin (Benoît Magimel) - một chuyên gia ẩm thực với đam mê sáng tạo nên những món ăn trọn vẹn từ hương vị đến hình thức. Khởi nguồn từ tình yêu ẩm thực để cùng nhau tạo ra nhiều món ăn tinh tế và lộng lẫy trong suốt 20 năm, thu hút các thực khách từ khắp nơi trên thế giới đến thưởng thức, tình yêu đôi lứa dần nảy nở giữa Eugénie và Dodin. Tu', 'Trần Anh Hùng', 1, '2D', 'https://www.youtube.com/watch?v=pXQYvo7OJCE'),
(145, 'NGƯỜI CHẾT TRỞ VỀ', '2024-03-21', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/deadman.jpg', 99, 'VN', 'Bị dồn vào đường cùng, Lee Man Jae (Jo Jin Woong) phải bán cả tên của mình để tồn tại. Khi đứa con đầu lòng chuẩn bị chào đời, Man Jae quyết định thực hiện một phi vụ lớn cuối cùng, nhưng lại bị vướng vào vụ tham ô trị giá 100 tỉ won. Anh sống như một kẻ đã chết, cho đến một ngày kia, một chính trị gia họ Shim bí ẩn (Kim Hee Ae) đề nghị sẽ giúp anh lấy lại danh tính và cuộc đời mình. Lee Man Jae bắt đầu hành trình \"trở về từ cõi chết\", đồng thời lật mở những bí mật nhơ nhuốc của xã hội.', 'Ha Jun Won', 1, '2D', 'https://www.youtube.com/watch?v=e0M29ran6MA'),
(146, 'BIỆT ĐỘI SĂN MA: KỶ NGUYÊN BĂNG GIÁ', '2024-03-28', 'P', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/biet-doi-san-ma.jpg', 99, 'VN', 'Sau các sự kiện của Ghostbusters: Afterlife, gia đình Spengler đang tìm kiếm cuộc sống mới ở Thành phố New York. Nhóm săn ma bao gồm Ray, Winston và Podcast sử dụng công nghệ mới để chống lại các mối đe dọa chết người cổ xưa đang ẩn náu trong các vật dụng hàng ngày. Thế nhưng, họ sẽ phải đối đầu với một thế lực đen tối hùng mạnh mới.', 'Gil Kenan', 1, '2D', 'https://www.youtube.com/watch?v='),
(147, 'GODZILLA VS KONG: ĐẾ CHẾ MỚI', '2024-03-28', 'K', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/godzilla-vs-kong-poster.jpg', 99, 'VN', 'Bom tấn hành động Godzilla x Kong: Đế Chế Mới tung trailer đầu tiên. Từng đối đầu nhau và làm rung chuyển phòng vé toàn cầu trong phần phim Godzilla Đại Chiến Kong, giờ đây trong Godzilla x Kong: Đế Chế Mới hai đại titan sẽ có màn bắt tay huyền thoại, cùng nhau bảo vệ sự sống trên địa cầu.', 'Adam Wingard', 1, '2D', 'https://www.youtube.com/watch?v=Pxge99xjWDQ'),
(148, 'B4S - TRƯỚC GIỜ \"YÊU\"', '2024-04-11', 'T18', 'https://cinestar.com.vn/pictures/Cinestar/02-2024/b4s.jpg', 99, 'VN', 'B4S - Trước Giờ \"Yêu\" sẽ bắt đầu bằng một đêm \"nhớ đời\" của hai nhóm bạn thân tại quán bar. Và sau đó, khán giả sẽ được theo dõi câu chuyện tình yêu của từng người trong \"đêm định mệnh\" ấy.', 'Tùng Leo, Michael Thái, Huỳnh Anh Duy', 1, '2D', 'https://www.youtube.com/watch?v=MGmgt6_JX2I'),
(149, 'CÁI GIÁ CỦA HẠNH PHÚC', '2024-04-25', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/cai-gia-cua-hanh-phuc.jpg', 99, 'VN', '', 'Nguyễn Ngọc Lâm', 2, '2D', 'https://www.youtube.com/watch?v=kUbrvnhKXyA'),
(150, 'NHỮNG KẺ THÁCH ĐẤU', '2024-05-09', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/05-2024/nhung-ke-thach-dau.jpg', 99, 'VN', 'Đến từ nhà làm phim với tầm nhìn đáng nể Luca Guadagnino, “Những Kẻ Thách Đấu” có sự góp mặt của Zendaya trong vai Tashi Duncan, một cựu thần đồng quần vợt, một người không từ bất cứ thủ đoạn nào để dành chiến thắng (dù là trong hay ngoài sân đấu). Cô kết hôn với một nhà vô địch đang đối mặt với chuỗi trận thua liên tiếp. Kế hoạch tìm lại hào quang cho chồng của Tashi đối mặt với bước ngoặt lớn khi đối thủ mà chồng cô phải đối mặt là Patrick. Đó vừa là người bạn thân cũ của chồng cô, và cũng là ', 'Luca Guadagnino', 2, '2D', 'https://www.youtube.com/watch?v='),
(151, 'TAROT', '2024-05-09', 'T16', 'https://cinestar.com.vn/pictures/Cinestar/05-2024/tarot.jpg', 99, 'VN', 'Bạn sẽ nhìn thấy ai khi trút hơi thở cuối cùng?', 'Spenser Cohen, Anna Halberg', 2, '2D', 'https://www.youtube.com/watch?v=ekMIW_8xc1U'),
(152, 'NHỮNG NGƯỜI BẠN TƯỞNG TƯỢNG', '2024-05-16', 'T13', 'https://cinestar.com.vn/pictures/Cinestar/05-2024/nhung-nguoi-ban-tuong-tuong.jpg', 99, 'VN', 'Bộ phim xoay quanh một cô bé bất ngờ phát hiện ra mình có thể nhìn thấy những người bạn tưởng tượng của mọi người. Và cuộc hành trình bắt đầu khi cô bé sử dụng siêu năng lực của mình để giúp đỡ những người bạn tưởng tượng này tránh khỏi việc bị bỏ rơi và lãng quên bằng cách tìm kiếm, kết nối chúng với những đứa trẻ.', 'John Krasinski', 2, '2D', 'https://www.youtube.com/watch?v=QNtuCo8WJZ4'),
(153, 'FURIOSA', '2024-05-23', 'T16', 'https://cinestar.com.vn/pictures/Cinestar/05-2024/furiosa.jpg', 99, 'VN', 'Furiosa: A Mad Max Saga kể về hành trình Furiosa bị bắt cóc khỏi Vùng Xanh của Những người mẹ và phải vật lộn tồn tại qua những sa mạc rộng lớn - nơi đói khát nhiên liệu.', 'George Miller', 2, '2D', 'https://www.youtube.com/watch?v='),
(154, 'GARFIELD - MÈO BÉO SIÊU QUẬY', '2024-05-23', 'P', 'https://cinestar.com.vn/pictures/Cinestar/05-2024/meo-beo-sieu-quay.jpg', 99, 'VN', 'Mèo vàng Garfield siêu quậy quay trở lại trong bộ phim mới nhất Garfield Movie. Đón xem ngay vào dịp hè năm 2024 nhé!', 'Mark Dindal', 2, '2D', 'https://www.youtube.com/watch?v=v_vOB67HtgY'),
(155, 'NHỮNG MẢNH GHÉP CẢM XÚC 2', '2024-06-13', 'P', 'https://cinestar.com.vn/pictures/Cinestar/06-2024/inside-out-2.jpg', 99, 'VN', 'ĐÓN CHỜ NHỮNG MẢNH GHÉP CẢM XÚC 2 (INSIDE OUT 2) - DỰ KIẾN KHỞI CHIẾU 6/2024', 'Kelsey Mann', 2, '2D', 'https://www.youtube.com/watch?v=ij0gHMk8dP0'),
(156, 'NGÀY XƯA CÓ MỘT CHUYỆN TÌNH', '2024-06-13', 'T16', 'https://cinestar.com.vn/pictures/Cinestar/05-2024/ngay-xua-co-mot-chuyen-tinh.jpg', 99, 'VN', '', 'Trịnh Đình Lê Minh', 2, '2D', 'https://www.youtube.com/watch?v='),
(157, 'VÙNG ĐẤT CÂM LẶNG: NGÀY MỘT', '2024-06-27', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/06-2024/vung-dat-cam-lang.jpg', 99, 'VN', 'Chứng kiến ngày mà cả thể giới bỗng im lặng.', 'Michael Sarnoski', 2, '2D', 'https://www.youtube.com/watch?v=qLEYF8KX6GA'),
(158, 'GODZILLA x KONG: ĐẾ CHẾ MỚI 2D (K)', '2024-03-26', 'K', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/godzilla-x-kong.jpg', 125, 'VN', 'Kong và Godzilla - hai sinh vật vĩ đại huyền thoại, hai kẻ thủ truyền kiếp sẽ cùng bắt tay thực thi một sứ mệnh chung mang tính sống còn để bảo vệ nhân loại, và trận chiến gắn kết chúng với loài người mãi mãi sẽ bắt đầu.', 'Adam Wingard', 1, '2D', 'https://www.youtube.com/watch?v=Pxge99xjWDQ'),
(159, 'QUỶ THUẬT (T16)', '2024-03-28', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/quy-thuat.jpg', 120, 'VN', 'Sylvie phải gánh chịu lời nguyền do tội ác man rợ mà cha chồng cô đã gây ra. Ngày cô mang thai đứa con của mình cũng chính là ngày ác quỷ trở về từ cõi chết.', 'Visal Sem', 1, '2D', 'https://www.youtube.com/watch?v='),
(160, 'QUỶ CÁI (T18)', '2024-04-03', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/quy-cai.jpg', 105, 'Phụ Đề', 'Được sự chỉ định của một giáo sư, năm sinh viên đại học cuối cấp được mời đến một biệt thự cổ thuộc ML. Salukjit, một người phụ nữ lớn tuổi chào đón họ bằng thái độ kỳ lạ của mình. Trước khi quyết định ra đi hay ở lại được đưa ra, ML. Salukjit khiến họ khiếp sợ và bộc lộ sức mạnh ma quỷ của mình.', 'Artistaya Arriyawongsa', 1, '2D', 'https://www.youtube.com/watch?v=CUYO_dC8vzI'),
(161, 'GODZILLA x KONG: ĐẾ CHẾ MỚI 3D (K)', '2024-03-26', 'K', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/03-2024/godzilla-x-kong.jpg', 125, 'Phụ Đề', 'Kong và Godzilla - hai sinh vật vĩ đại huyền thoại, hai kẻ thủ truyền kiếp sẽ cùng bắt tay thực thi một sứ mệnh chung mang tính sống còn để bảo vệ nhân loại, và trận chiến gắn kết chúng với loài người mãi mãi sẽ bắt đầu.', 'Adam Wingard', 1, '3D', 'https://www.youtube.com/watch?v=Pxge99xjWDQ'),
(162, 'THANH XUÂN 18x2: LỮ TRÌNH HƯỚNG VỀ EM (T13)', '2024-04-02', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/thanh-xuan-18x2-poster-2.jpg', 135, 'Phụ Đề', 'Ký ức tình đầu ùa về khi Jimmy nhận được tấm bưu thiếp từ Ami. Cậu quyết định một mình bước lên chuyến tàu đến Nhật Bản gặp lại người con gái cậu đã bỏ lỡ 18 năm trước. Mối tình day dứt thời thanh xuân, liệu sẽ có một kết cục nào tốt đẹp khi đoàn tụ?', 'Michihito Fujii', 1, '2D', 'https://www.youtube.com/watch?v=kpzTxHLwTJ4'),
(163, 'MONKEY MAN BÁO THÙ (T18)', '2024-04-03', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/monkey-man.jpg', 135, 'Phụ Đề', 'Một chàng trẻ vô danh, đã bắt đầu cuộc hành trình trả thù chống lại những kẻ lãnh đạo tham nhũng đã sát hại mẹ anh và đàn áp những người nghèo khổ và yếu thế hơn.', 'Dev Patel', 1, '2D', 'https://www.youtube.com/watch?v=TQbLpsc7cGs'),
(164, 'ĐIỀM BÁO CỦA QUỶ (T18)', '2024-04-03', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/diem-bao-cua-quy.jpg', 135, 'Phụ Đề', 'Khi một cô gái người Mỹ được đưa đến Rome để bắt đầu phụng sự Giáo Hội, cô đã phát hiện ra thế lực hắc ám khiến cô hoài nghi về đức tin của chính mình, đồng thời hé lộ một âm mưu kinh hoàng nhằm tái sinh linh hồn ác quỷ đầu thai đến nhân thế.', 'Arkasha Stevenson', 1, '2D', 'https://www.youtube.com/watch?v=s3kWzhwsbpU'),
(165, 'TRÒ CHƠI CHẾT CHÓC (T16)', '2024-04-04', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/tro-choi-chet-choc-poster.jpg', 105, 'Phụ Đề', 'Tong và những người bạn chơi trốn tìm tại một ngôi nhà hoang. Bất ngờ, vụ nổ xảy ra khiến Noo Aon - người bạn được Tong đưa đi trốn ở nơi bí mật mắc kẹt. 13 năm sau, một em bé giống hệt Noo Aon xuất hiện và một loạt cái chết bí ẩn diễn ra trong hội bạn chơi trốn tìm năm đó', 'Nirun Toomprecha', 1, '2D', 'https://www.youtube.com/watch?v='),
(166, 'NGƯỜI GIAO HÀNG ĐÊM (HIFF)', '2024-04-07', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Night-Courier.jpg', 112, 'Phụ Đề', 'Ở trung tâm Riyadh, nơi sự tuyệt vọng và cơ hội giao thoa, MANDOOB mang đến câu chuyện hấp dẫn về Fahad Algadaani, một người đàn ông tinh thần yếu đuối đang chạy đua với thời gian để cứu người cha ốm yếu của mình.', 'Ali KALTHAMI', 1, '2D', 'https://www.youtube.com/watch?v='),
(167, 'LỜI NGUYỀN QUỶ ÁM (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/The-Cursed-_Land.jpg', 115, 'Phụ Đề', 'Sau cái chết của vợ, Mit cùng cô con gái tuổi teen May chuyển đến một ngôi nhà tồi tàn nằm ở vùng ngoại ô có đa số người Hồi giáo ở Bangkok. Là một người hoàn toàn hoài nghi, Mit loại bỏ những lá bùa trong nhà, bất chấp những lời cảnh báo của người dân địa phương, và trong quá trình đó giải phóng một djinn giận dữ và lời nguyền 200 năm tuổi của nó. Khi Mit chìm vào cơn mê sảng và tự làm hại bản thân, May phải thực hiện hành trình về phía nam để tìm kiếm sự giúp đỡ.', 'Panu Aree', 1, '2D', 'https://www.youtube.com/watch?v='),
(168, 'ĐÊM TỐI TRƯỚC BÌNH MINH (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/last-shadow-at-first-light.jpg', 120, 'Phụ Đề', 'Cô bé 16 tuổi Ami quyết định đi từ Singapore qua Nhật Bản sau khi nhiều hình ảnh kỳ lạ cứ đến với mình. Một người cậu lái taxi, một thành viên trong nhà cô chưa bao giờ gặp, sẽ trở thành người giám hộ kiêm chỉ dẫn địa phương. Chuyến đi này hứa hẹn sẽ làm cô và cậu thêm phần gần gũi và khiến khung cảnh, suy nghĩ quanh cô thay đổi liên hồi.', 'Nicole Midori Woodford', 1, '2D', 'https://www.youtube.com/watch?v='),
(169, 'MÙA THU (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Autumn.jpg', 114, 'Phụ Đề', 'Tại một thị trấn nhỏ của Bồ Đào Nha, một gia đình bị đảo lộn khi con trai họ rời đi học ở London. Chỉ tập trung vào những giờ nghỉ học khi anh trở về nhà (Đông, Xuân, Hạ, Thu), chúng tôi quan sát những khoảnh khắc về tuổi trưởng thành của một cô con gái, cuộc khủng hoảng giữa cuộc đời của một người cha, sự giải phóng của một đứa con trai và một người mẹ đang học cách đương đầu với một “cơn đau” tổ rỗng\".', 'Antonio Sequeira', 1, '2D', 'https://www.youtube.com/watch?v='),
(170, 'NGÀY VÔ ƯU (HIFF)', '2024-04-07', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/carefree-days.jpg', 125, 'Phụ Đề', 'Thành phố Thẩm Dương ở vùng Đông Bắc Trung Hoa đang suy tàn. Cô Hứa Linh Linh chỉ mới 25, mong được tình yêu và gia đình, đang mang bệnh ure máu. Trong lúc gia đình rối ren và biến đổi không ngừng, người cha rắc rối của cô lại quay về. Cô cùng hai người bạn là Đàm Na và Triệu Đông Dương tìm thấy chỗ tựa ở nhau. Một ngày nọ cả ba cùng thực hiện một chuyến đi hứa hẹn sẽ tiết lộ những mảng phức tạp của bản chất và cảm xúc con người trong cõi đời mờ sương.', 'Ming LIANG', 1, '2D', 'https://www.youtube.com/watch?v='),
(171, 'CẢM ƠN NGƯỜI, HUYỀN THIÊN THƯỢNG ĐẾ (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Be-With-Me.jpg', 140, 'Phụ Đề', 'Sau khi từ chối người cầu hôn thứ hai, Faye (Ariel LIN), đam mê cả sự lãng mạn và sự nghiệp, nhớ lại rằng ông nội cô là người đàn ông đầu tiên chỉ cho cô con đường của thế giới. Đây là câu chuyện tưởng nhớ, tưởng nhớ Ông Nội đã khuất từ lâu. Nhớ là vượt lên, nên đó là câu chuyện của thời gian và không gian, chồng chéo và đan xen. Đó cũng là hành trình tìm kiếm tình yêu và công việc, một hành trình tinh thần và cảm xúc; và qua đó các giá trị được xem xét lại và cuộc sống được tái khẳng định. Cuối', 'Wern-ying Hwarng', 1, '2D', 'https://www.youtube.com/watch?v='),
(172, 'CÓ THỜI TUỔI XANH NHƯ THẾ (HIFF)', '2024-04-07', 'K', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Push-Pause.jpg', 100, 'Phụ Đề', 'Phim lấy bối cảnh ở Tokyo trong thời gian diễn ra Thế vận hội giữa bối cảnh đại dịch COVID-19. Mệt mỏi vì cuộc sống vội vã, những người trẻ tập trung tại một nhà khách nhỏ ở Tokyo, nơi họ khám phá con đường riêng của mình và trưởng thành thông qua những mối quan hệ và trải nghiệm mới. Bộ phim truyền hình tổng hợp về tuổi trẻ xoay quanh chủ đề “sự đột phá” và khắc họa sự trưởng thành khiêm tốn của những người trẻ tuổi.', 'Ryoma KOSASA', 1, '2D', 'https://www.youtube.com/watch?v='),
(173, 'NHỮNG ĐỨA TRẺ TRONG SƯƠNG (HIFF)', '2024-04-07', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/nhung-dua-tre-trong-suong.jpg', 100, 'Phụ Đề', 'Phim kể câu chuyện của cô bé Má Thị Di, người Mông, 14 tuổi. Một ngày mùa xuân, Di được cậu bé Vang trạc tuổi chọn làm vợ. Di cố gắng chống lại sự sắp đặt theo truyền thống. Mẹ của em mâu thuẫn giữa việc tôn trọng tục lệ hay bảo vệ hạnh phúc của con. Trong khi bà nội và bố cho Di quyền tự quyết định.', 'Hà Diễm Lệ', 1, '2D', 'https://www.youtube.com/watch?v='),
(174, 'TÚY SINH MỘNG TỬ (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/dreaming-_-dying.jpg', 90, 'Phụ Đề', 'Ba người bạn trung niên hội ngộ sau nhiều năm xa cách. Tất cả \r\nquyết định thổ lộ những cảm xúc chưa từng bày tỏ. Tuy nhiên, kỳ nghỉ của họ chuyển biến đột ngột khi những sự việc ẩn giấu trong quá khứ có nguy cơ trỗi dậy.', 'Nelson Yeo', 1, '2D', 'https://www.youtube.com/watch?v='),
(175, 'ORPHEA SUY TÌNH (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Orphea-In-_Love.jpg', 80, 'Phụ Đề', 'Nele là một nhân viên trung tâm cuộc gọi trẻ tuổi, người có ánh trăng như một nhân viên phòng áo choàng tại Nhà hát Nhà hát Bang. Khi cô ấy yêu vũ công đường phố nhỏ Kolja, cô ấy phải đối đầu với những con quỷ trong quá khứ của mình và xuống thế giới ngầm. Đồng thời, trinh sát tài năng Höllbach nhận thấy tài năng ca hát của Nele và mang đến cho cô một cơ hội tuyệt vời cho sự nghiệp như một ca sĩ opera. Sự chuyển thể hiện đại của Axel Ranisch với Orpheus và Eurydice là một pastiche opera điện ảnh', 'Axel Ranisch', 1, '2D', 'https://www.youtube.com/watch?v='),
(176, 'HY VỌNG THẲM XANH (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Blue_Imagine.jpg', 93, 'Phụ Đề', 'NOEL, một nữ diễn viên đầy tham vọng, đã giữ im lặng khi là nạn nhân của vụ cưỡng hiếp. Không thể chấp nhận được quá khứ của mình, cô tìm đến một ngôi nhà an toàn dành cho phụ nữ tên là \"Blue Imagine\". Quá trình chữa lành chậm rãi bắt đầu khi cô tương tác với những cư dân khác đã trải qua trải nghiệm lạm dụng tương tự. Một ngày nọ, Noel biết rằng một nữ diễn viên trẻ đã bị đạo diễn phim MINORU, người cũng đã lợi dụng cô hai năm trước, tấn công tình dục. Noel và những người khác tìm thấy sức mạnh', 'Urara Matsubayashi', 1, '2D', 'https://www.youtube.com/watch?v='),
(177, 'CÚ VÀ CHIM SE SẺ (HIFF)', '2024-04-07', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/cu-va-chim-se-se.jpg', 110, 'Phụ Đề', 'Ở Sài Gòn thời hiện đại, ba người xa lạ cô đơn tạo thành một gia đình độc nhất vô nhị khi một đứa trẻ mồ côi mười tuổi đóng vai bà mối cho một người coi vườn thú và một tiếp viên hàng không xinh đẹp.', 'Stephane Gauger', 1, '2D', 'https://www.youtube.com/watch?v='),
(178, 'CHỜ NGÀY TRỜI QUANG (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/waiting-for-the-light-to-change.jpg', 89, 'Phụ Đề', 'Trong chuyến đi nghỉ mát bên bờ biển kéo dài một tuần, Amy, vừa trải qua quá trình giảm cân ấn tượng, thấy mình phải vật lộn giữa lòng trung thành với người bạn thân Kim và sự thu hút của cô đối với bạn trai mới của Kim.', 'Linh Tran', 1, '2D', 'https://www.youtube.com/watch?v='),
(179, 'CÔ BA SÀI GÒN (HIFF)', '2024-04-07', 'P', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/co-ba-sai-gon.jpg', 100, 'Phụ Đề', 'Câu chuyện phim kể về quý cô thanh lịch Như Ý, bảo bối của bà chủ tiệm may áo dài Thanh Nữ - Thanh Mai (Ngô Thanh Vân), cùng niềm say mê với những bộ âu phục sang trọng, quý phái. Trong khi cả gia tài của gia đình là tiệm may nức tiếng mà mẹ vẫn luôn gìn giữ cho cô, cô ba tuyên bố không nối nghiệp mẹ làm cho mâu thuẫn bùng nổ. Những tưởng sau đó sẽ là sự xuất hiện của những madame, quý ngài thời đó tiếp tục đẩy cao trào phim lên cao hơn, nhưng không, biên kịch phim đã không để điều đó xảy ra khi', 'Trần Bửu Lộc, Kay Nguyen', 1, '2D', 'https://www.youtube.com/watch?v='),
(180, 'THIÊN ĐƯỜNG (HIFF)', '2024-04-07', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/wonderland.jpg', 115, 'Phụ Đề', 'Để trang trải chi phí học tập ở nước ngoài cho con gái Eileen, Loke bán căn nhà của gia đình mình và chuyển đến thuê một căn nhà nhỏ có một phòng ngủ. Ở đó, anh gặp Tan, người hàng xóm đã giúp anh viết thư cho Eileen và đọc thư của cô cho anh nghe. Trong khi đó, Tan tìm thấy niềm an ủi trước sự cống hiến của Loke cho con gái mình, khi anh khao khát được hòa giải với cô con gái đã bị ghẻ lạnh của mình.', 'Yee-Wei Chai', 1, '2D', 'https://www.youtube.com/watch?v='),
(181, 'NHỮNG NẤC THANG SẺ CHIA (HIFF)', '2024-04-07', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Oasis-Of-Now.jpg', 90, 'Phụ Đề', 'Góc cầu thang của một chung cư cũ ở Kuala Lumpur là nơi một bà mẹ và người con gái thường lén lút gặp nhau, chơi trò chơi và cố gắng trò chuyện. Người mẹ nghĩ mình biết những gì tốt nhất cho con, trong khi người con đang chờ một lời hứa từ người mẹ. Sau đó, ai nấy cũng sẽ về căn hộ của mình. Người phụ nữ sẽ tiếp tục cuộc sống thường nhật trong không gian mình đã quá quen thuộc. Nhưng những gì mắt thấy ít khi là toàn bộ sự thật.', 'Chee Sum CHIA', 1, '2D', 'https://www.youtube.com/watch?v='),
(182, 'NƠI SÓNG KHÔNG VỖ BỜ (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Solids-By-The-Seashore.jpg', 105, 'Phụ Đề', 'Shati là một cô gái đạo Hồi xuất thân từ gia đình bảo thủ còn Feng là một nghệ sĩ thị giác. Họ gặp gỡ trên một bãi biển ở miền Nam Thái Lan. Khi cả hai trở nên gần gũi, Shati phải đấu tranh với quan điểm truyền thống ngăn cấm tình yêu đồng giới. Bất chấp những sự việc kỳ lạ xảy ra theo lời tiên tri của người bà quá cố, Shati quyết định đi theo con đường riêng và chấp nhận bản chất của mình.', 'Patiparn BOONTARIG', 1, '2D', 'https://www.youtube.com/watch?v='),
(183, 'ĐÁM CƯỚI CUỐI CÙNG (HIFF)', '2024-04-07', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/top-end-wedding.jpg', 100, 'Phụ Đề', 'Bộ phim kể về Lauren, một luật sư dự định kết hôn với chồng sắp cưới ở quê nhà nhưng phát hiện ra rằng mẹ cô đã đột ngột rời bỏ gia đình.', '', 1, '2D', 'https://www.youtube.com/watch?v='),
(184, 'MÙA ỔI (HIFF)', '2024-04-07', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/mua-oi.jpg', 110, 'Phụ Đề', 'Năm 13 tuổi, Hòa bị té từ trên cao và bị ngưng trí nhớ. Cuộc sống của Hòa từ đó về sau luôn là một cậu bé ở tuổi 13. Trong căn hộ tập thể, Hòa là “người nhà” của tất cả các gia đình.', 'Đặng Nhật Minh', 1, '2D', 'https://www.youtube.com/watch?v='),
(185, 'PHÚC ÂM THƯ CỦA QUÁI THÚ  (HIFF)', '2024-04-07', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/The-Gospel-Of-The-Beast.jpg', 130, 'Phụ Đề', 'Phim kể về Mateo, một thiếu niên chuyên gây rối nhưng luôn yêu thương gia đình. Cậu trở thành trụ cột khi cha biến mất. Sau khi vô tình giết chết người bạn cùng lớp, cậu nhờ một gã tên Berto tìm đường tẩu thoát rồi bị đưa vào băng đảng tội phạm. Ngày càng lún sâu trên con đường tội lỗi, Mateo bị tha hóa bởi bạo lực và tuyệt vọng, cuối cùng trở thành một tên côn đồ hung bạo.', 'Sheron Dayoc', 1, '2D', 'https://www.youtube.com/watch?v='),
(186, 'HỒN GIÓ (HIFF)', '2024-04-07', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/City-Of-Wind.jpg', 103, 'Phụ Đề', 'Pháp sư tâm linh là một thành viên quan trọng của cộng đồng, người mà mọi người đều trông cậy vào khi cần sự hướng dẫn về đạo đức và tâm linh. Điều gì sẽ xảy ra khi pháp sư đó là một học sinh trung học 17 tuổi, người phải cân bằng giữa trách nhiệm tâm linh sâu sắc của mình đồng thời phải vật lộn với một cuộc sống khác - cuộc sống của một học sinh trung học - làm việc chăm chỉ để thành công trong xã hội lạnh lùng, nhẫn tâm của Mông Cổ hiện đại. Giới thiệu Ze, pháp sư Mông Cổ hiền lành 17 tuổi....', 'Lkhagvadulam PUREV-OCHIR', 1, '2D', 'https://www.youtube.com/watch?v='),
(187, '13 NGÒI NỔ (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/13-Bombs.jpg', 160, 'Phụ Đề', 'Cuộc sống sôi động ở Jakarta dường như khựng lại sau khi một nhóm khủng bố dọa rằng họ đã để 13 quả bom đâu đó trong thành phố. Cục Tình Báo và các đặc vụ dần dần lần đến Oscar (Chicco Kurniawan) và William (Ardhito Pramono), đồng sáng lập của một nền tảng giao dịch tiền ảo crypto. Họ và một số tiền hàng tỷ rupiah đang là tâm điểm của Arok (Rio Dewanto), dẫn đầu của nhóm khũng bố. Một là hắn sẽ có thứ hắn muốn, hai là sẽ có một tiếng nổ vang trời mỗi tám giờ đồng hồ.', 'Angga Dwimas Sasongko', 1, '2D', 'https://www.youtube.com/watch?v='),
(188, 'LỬA GIỮA BIỂN ĐỜI (HIFF)', '2024-04-07', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Fire-O_n-The-Water.jpg', 130, 'Phụ Đề', 'Karthi là một trợ lý sản xuất phim thương mại bất mãn với công việc hiện tại. Anh đang thực hiện một kịch bản chân thực với dấu ấn cá nhân, nhưng dự án này không được ủng hộ bởi các nhà tài trợ trong ngành. Trên hành trình theo đuổi ước mơ đầy tuyệt vọng, Karthi đánh mất tình yêu và rơi vào cảnh nghiện rượu, cho đến khi anh tìm được một người bạn cùng chí hướng.', 'SUN-J PERUMAL', 1, '2D', 'https://www.youtube.com/watch?v='),
(189, 'CÔ VỢ LÝ TƯỞNG (HIFF)', '2024-04-07', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Frau.jpg', 120, 'Phụ Đề', 'Vanya làm việc tại cửa hàng “Hunter & Fisher” còn Kristina là vũ công ballet. Cả hai xem nhau là đối tượng yêu đương nghiêm túc. Họ cố gắng dựng xây một gia đình nhưng qua thời gian nhận ra liên kết giữa cả hai không thực sự bền chặt. Tổ ấm này được tạo nên bởi nỗi sợ cô đơn chứ không phải tình yêu. Chẳng ích gì khi chung sống với một người chỉ để có ai đó bên cạnh qua ngày.', 'Lyubov Mulmenko', 1, '2D', 'https://www.youtube.com/watch?v='),
(190, 'MƯỢN XÁC (HIFF)', '2024-04-08', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/Tenement.jpg', 95, 'VN', 'Sau cái chết của mẹ cô, một họa sĩ truyện tranh người Campuchia gốc Nhật quyết định đi du lịch đến Campuchia cùng với bạn trai của mình để tìm hiểu thêm về đất nước mà mẹ cô đã trốn chạy. Cô đoàn tụ với gia đình đã mất và chuyển đến căn hộ nơi mẹ cô từng sống. Khi cô cố gắng tìm hiểu thêm về quá khứ của mình, cô phải đối mặt với những sự kiện kỳ lạ trong tòa nhà gợi ý điều gì đó đen tối hơn đang xảy ra với cư dân. Điều đầu tiên xuất hiện như sự cân nhắc quan tâm quá mức của cộng đồng đối với nhữ', 'Inrasothythep NETH,...', 1, '2D', 'https://www.youtube.com/watch?v='),
(191, 'ĐÊM TỐI RỰC RỠ (HIFF)', '2024-04-08', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/HIFF/dem-toi-ruc-ro.jpg', 115, 'Phụ Đề', 'Phim gói gọn trong một buổi đêm của gia đình ở miền Nam, ông Toàn (Kiến An) cùng vợ Gái (Phương Dung) đang lo tang lễ cho người cha giàu có mới qua đời. Họ tổ chức buổi lễ hoành tráng, náo nhiệt đúng như phong tục địa phương. Tuy nhiên, ông Toàn đang nợ xã hội đen rất nhiều tiền vì thua bạc, trong khi đã bán hết gia sản của cha để lại. Những người đòi nợ bao vây, canh chừng quanh ngôi nhà để đe dọa, cấm ông bỏ trốn.', 'Aaron Toronto', 1, '2D', 'https://www.youtube.com/watch?v='),
(192, 'BIỆT ĐỘI SĂN MA (T13): KỶ NGUYÊN BĂNG GIÁ', '2024-04-11', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/biet-doi-san-ma-SCDB.jpg', 115, 'VN', 'Sau các sự kiện của Ghostbusters: Afterlife, gia đình Spengler đang tìm kiếm cuộc sống mới ở Thành phố New York. Nhóm săn ma bao gồm Ray, Winston và Podcast sử dụng công nghệ mới để chống lại các mối đe dọa chết người cổ xưa đang ẩn náu trong các vật dụng hàng ngày. Thế nhưng, họ sẽ phải đối đầu với một thế lực đen tối hùng mạnh mới.', 'Gil Kenan', 1, '2D', 'https://www.youtube.com/watch?v=KMJCBpvtzq8'),
(193, 'ĐÓA HOA MONG MANH (T13)', '2024-04-11', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/doa-hoa-mong-manh.jpg', 105, 'Phụ Đề', 'Thạch Thảo là một cô gái xinh đẹp, có giọng hát hay, nhưng sớm mồ côi cha mẹ và được một người chị họ à ca sĩ Ellie cưu mang. Trong 1 đêm nhạc tại phòng trà, Ellie bị mất giọng nên đã nhờ Thạch Thảo hát thế không ngờ lần đầu tiên cất tiếng hát trên sân khấu, Thạch Thảo lập tức lọt vào mắt xanh của một NSX âm nhạc tên là Sơn. Ngay sau đó, Thạch Thảo đã được Trung tâm SET do vợ chồng Sơn và Yvonne làm chủ mời hợp tác thu âm và quay một bộ phim ca nhạc tên là “Đoá hoa mong manh”. Với sự đầu tư bài ', 'Mai Thu Huyền', 1, '2D', 'https://www.youtube.com/watch?v='),
(194, 'NGƯỜI \"BẠN\" TRONG TƯỞNG TƯỢNG (T13)', '2024-04-11', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/imaginary.jpg', 115, 'Phụ Đề', 'Khi Jessica (DeWanda Wise) chuyển về ngôi nhà thời thơ ấu cùng gia đình thì cô con gái riêng bé bỏng Alice (Pyper Braun) vô tình tìm thấy một chú gấu nhồi bông tên là Chauncey ở tầng hầm. Cô bắt đầu chơi những trò chơi cùng với Chauncey, thoạt đầu các trò chơi đều rất vui tươi, thú vị nhưng càng về sau, các trò chơi dần trở nên nguy hiểm hơn. Khi những hành động của Alice trở nên kì lạ, Jessica nhận ra Chauncey không chỉ là một chú gấu nhồi bông vô hại bình thường mà nó đã mang đến rất nhiều nỗi', 'Jeff Wadlow', 1, '2D', 'https://www.youtube.com/watch?v=qSTMIcuMHgU'),
(195, 'NGÀY TÀN CỦA ĐẾ QUỐC (T18)', '2024-04-11', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/ngay-tan-cua-de-quoc_1.jpg', 125, 'Phụ Đề', 'Trong một tương lai gần, một nhóm các phóng viên chiến trường quả cảm phải đấu tranh với thời gian và bom đạn nguy hiểm để đến kịp Nhà Trắng giữa bối cảnh nội chiến Hoa Kỳ đang tiến đến cao trào.', 'Alex Garland', 1, '2D', 'https://www.youtube.com/watch?v=qmG2iWu4fM8'),
(196, 'HÀO QUANG ĐẪM MÁU (T18)', '2024-04-11', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/hao-quang-dam-mau-poster.jpg', 115, 'Phụ Đề', 'Câu chuyện kể về Lee Soo-yeon (do Ji-yeon thủ vai) - một nữ minh tinh màn bạc đang ở đỉnh cao sự nghiệp nhưng bất chợt tuột dốc không phanh vì tai nạn chết người do chính cô gây ra trong lúc say rượu. Sau thời gian dài “ở ẩn” để trả giá cho sai lầm, Lee Soo-yeon bắt đầu nuôi mộng trở lại với khán giả nhưng bê bối từ quá khứ của cô luôn bị người đời đay nghiến, châm chọc.', 'Yoo Young-su', 1, '2D', 'https://www.youtube.com/watch?v=4FxzLZ_aJpc'),
(197, 'CÁI GIÁ CỦA HẠNH PHÚC (T18)', '2024-04-17', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/cai-gia-cua-hanh-phuc-poster.jpg', 130, 'VN', 'Bà Dương và ông Thoại luôn cố gắng để xây dựng một hình ảnh gia đình tài giỏi và danh giá trong mắt mọi người. Tuy nhiên dưới lớp vỏ bọc hào nhoáng ấy là những biến cố và lục đục gia đình đầy sóng gió. Nhìn kĩ hơn một chút bức tranh gia đình hạnh phúc ấy, rất nhiều “khuyết điểm” sẽ lộ ra gây bất ngờ.', 'Nguyễn Ngọc Lâm', 1, '2D', 'https://www.youtube.com/watch?v=7Bysp9dT_Wg'),
(198, 'YÊU CUỒNG LOẠN (T18)', '2024-04-18', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/poster-yeu-cuong-loan.jpg', 115, 'VN', 'Cuộc tình mới chớm nở giữa nữ quản lý phòng tập Lou (Kristen Stewart) và vận động viên thể hình đầy tham vọng Jackie (Katy O\'Brian) khiến cả hai bị lún sâu vào chuỗi những rắc rối đẫm máu liên quan đến gia đình tội phạm khét tiếng của Lou.', 'Rose Glass', 1, '2D', 'https://www.youtube.com/watch?v=RoxIMuyIfws'),
(199, 'ANH HÙNG BÀN PHÍM', '2024-04-18', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/anh-hung-ban-phim-poster.jpg', 110, 'Phụ Đề', 'Im Sang-jin - một phóng viên mảng xã hội đã bị đình chỉ công tác sau bài phóng sự điều tra sai lệch về những lùm xùm của tập đoàn Manjun. Tưởng rằng phải chịu nỗi oan ức suốt đời, Im Sang-jin bất ngờ nhận được thông tin ẩn danh khẳng định anh không sai, mà mọi thứ đã bị thao túng bởi một “đội quân” trực tuyến: Chỉ cần có tiền, sự thật nào cũng hoá thành dối lừa, còn tin tức giả lại hoá thành sự thật. Quyết tâm dấn thân vào con đường điều tra “Team Aleph”, Im Sang-jin dần khám phá ra những bí mật', 'Ahn Guk Jin', 1, '2D', 'https://www.youtube.com/watch?v=tlpRjjHgZLo'),
(200, 'ABIGAIL', '2024-04-18', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/abigail.jpg', 98, 'Phụ Đề', 'Một nhóm tội phạm bắt cóc một diễn viên ba lê nhí - con gái của một ông trùm quyền lực trong thế giới ngầm. Chúng trốn đến một biệt thự biệt lập, nhưng không hề hay biết mình đang bị giam cầm cùng một \"cô bé\" hoàn toàn không bình thường.', 'Matt Bettinelli-Olpin, Tyler Gillett', 1, '2D', 'https://www.youtube.com/watch?v=c7JiYfYR9I4'),
(201, 'TU VIỆN MÁU (T18)', '2024-04-18', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/tu-vien-mau.jpg', 85, 'Phụ Đề', 'Với đức tin sâu sắc, Cecilia đến với một tu viện cổ kính, nằm giữa một vùng quê đẹp nên thơ tại nước Ý trong sự chào đón của mọi người. Thế nhưng, những sự kiện kỳ lạ liên tiếp xảy ra, một bước ngoặt đưa Cecilia đến một vị trí cô không thể ngờ tới. Cùng với đó, những bí mật kinh hoàng đằng sau vẻ bình yên của tu viện này dần lộ diện.', 'Michael Mohan', 1, '2D', 'https://www.youtube.com/watch?v=Iocr2svmDKU'),
(202, 'LUCA 2D PĐ: MÙA HÈ CỦA LUCA (P)', '2024-04-18', 'P', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/mua-he-cua-luca.jpg', 105, 'Phụ Đề', '\"Mùa Hè Của Luca\" kể về chuyến hành trình của cậu bé Luca tại hòn đảo Portorosso thuộc vùng biển Địa Trung Hải ở Ý tuyệt đẹp. Ở đây cậu đã làm quen và kết thân với những người bạn nhỏ mới và tận hưởng mùa hè đầy nắng, kem Gelato và cả món mì Ý trứ danh. Tuy nhiên có một điều không ổn lắm, Luca là một THỦY QUÁI và những người dân trên hòn đảo này lại không thích điều này chút nào.', 'Enrico Casarosa', 1, '2D', 'https://www.youtube.com/watch?v=2KT27tlBatE'),
(203, 'THẦN BÀI TRỞ LẠI TẤT TAY', '2024-04-18', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/all-in.jpg', 100, 'Phụ Đề', 'Mang danh thần bài trăm trận trăm thắng, Trình Gia Lãng phát hoảng khi siêu năng lực mắt thần đột nhiên mất vào tay một kẻ gà mờ - Hoàng Tiểu Thất. Từ đây, cả hai phải miễn cưỡng hợp lực hòng chiến thắng vua bài - Vi Nhất Phú và làm lộ ra bí mật động trời...', 'Matt Lai', 1, '2D', 'https://www.youtube.com/watch?v=UkL6dE89Fxo'),
(204, 'LUCA 2D LT: MÙA HÈ CỦA LUCA (P)', '2024-04-18', 'P', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/mua-he-cua-luca.jpg', 105, 'Lồng Tiếng', '\"Mùa Hè Của Luca\" kể về chuyến hành trình của cậu bé Luca tại hòn đảo Portorosso thuộc vùng biển Địa Trung Hải ở Ý tuyệt đẹp. Ở đây cậu đã làm quen và kết thân với những người bạn nhỏ mới và tận hưởng mùa hè đầy nắng, kem Gelato và cả món mì Ý trứ danh. Tuy nhiên có một điều không ổn lắm, Luca là một THỦY QUÁI và những người dân trên hòn đảo này lại không thích điều này chút nào.', 'Enrico Casarosa', 1, '2D', 'https://www.youtube.com/watch?v=2KT27tlBatE'),
(205, 'VÂY HÃM: KẺ TRỪNG PHẠT', '2024-04-25', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/vay-ham-ke-trung-phat.jpg', 110, 'Phụ Đề', 'Siêu cớm Ma Seok-do tái xuất để đối đầu với những tội phạm tinh vi trong giới công nghệ. Nắm đấm trứ danh liệu có phát huy được sức mạnh trước liên minh tội phạm của thiên tài công nghệ và ông trùm nhà cái lớn nhất châu Á?', 'Heo Myeong Haeng', 2, '2D', 'https://www.youtube.com/watch?v=DsFygmpE0k8'),
(206, 'LẬT MẶT 7: MỘT ĐIỀU ƯỚC', '2024-04-25', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/Lat-Mat-7-Mot-Dieu-Uoc.jpg', 95, 'Phụ Đề', 'Một câu chuyện lần đầu được kể bằng tất cả tình yêu, và từ tất cả những hồi ức xao xuyến nhất của đấng sinh thành', 'Lý Hải', 2, '2D', 'https://www.youtube.com/watch?v=xHpgjsgKJzo'),
(207, 'HÀNH TINH KHỈ', '2024-05-09', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/05-2024/hanh-tinh-khi.jpg', 99, 'Phụ Đề', 'Kingdom Of The Planet Of The Apes lấy bối cảnh nhiều năm sau triều đại của Proximus Ceasar trong War for the Planet of The Apes (2017). Khỉ trở thành giống loài thống trị thế giới, còn con người phải khép mình trong bóng tối. Triều đại độc tài mới được thiết lập. Noa – một chú khỉ trẻ đặt ra những câu hỏi về quá khứ của hành tinh khỉ và dấn thân vào hành trình chống lại đế chế mới.', 'Wes Ball', 2, '2D', 'https://www.youtube.com/watch?v=UXKijTQFJH4'),
(208, 'FURIOSA: CÂU CHUYỆN TỪ MAX ĐIÊN', '2024-05-23', 'T16', 'https://cinestar.com.vn/pictures/Cinestar/05-2024/furiosa.jpg', 99, 'VN', 'Furiosa: A Mad Max Saga kể về hành trình Furiosa bị bắt cóc khỏi Vùng Xanh của Những người mẹ và phải vật lộn tồn tại qua những sa mạc rộng lớn - nơi đói khát nhiên liệu.', 'George Miller', 2, '2D', 'https://www.youtube.com/watch?v='),
(209, 'NGÔI ĐỀN KỲ QUÁI 4', '2024-05-30', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/05-2024/ngoi-den-ky-quai-4.jpg', 99, 'VN', 'Hồn ma Nak với sức mạnh khủng khiếp nhất, đáng sợ nhất mà bộ đôi mỏ hỗn Balloon & First phải đối mặt để giải cứu cho trai đẹp Min Joon. Liệu hội bạn này sẽ giải được nghiệp mình tạo ra hay sẽ tan rã từ đây?', 'Phontharis Chotkijsadarsopon', 2, '2D', 'https://www.youtube.com/watch?v=AEH_cOieb7E'),
(210, 'NHỮNG KẺ THEO DÕI', '2024-06-06', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/06-2024/nhung-ke-theo-doi.jpg', 99, 'Phụ Đề', 'Theo chân Mina, một họa sĩ 28 tuổi bị lạc trong khu rừng hoang sơ ở phía tây Ireland. Khi Mina tìm được nơi trú ẩn, cô không hề biết rằng mình đã bị mắc kẹt cùng ba người lạ khác, mà tất cả đều đang bị theo dõi và săn lùng bởi những sinh vật bí ẩn mỗi đêm.', 'Ishana Shyamalan', 2, '2D', 'https://www.youtube.com/watch?v=7ZgdHXgZGGk'),
(211, 'KẺ TRỘM MẶT TRĂNG 4', '2024-07-04', 'P', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/07-2024/ke-trom-mat-trang.jpeg', 99, 'Phụ Đề', 'Gru phải đối mặt với kẻ thù mới là Maxime Le Mal và Valentina đang lên kế hoạch trả thù anh, buộc gia đình anh phải lẩn trốn đi nơi khác. Bên cạnh việc đấu tranh bảo vệ gia đình, Gru đồng thời còn phải tìm ra điểm chung với thành viên mới nhất trong nhà đó là Gru Jr.', 'Chris Renaud, Patrick Delage', 2, '2D', 'https://www.youtube.com/watch?v=c5HDtlajZjA'),
(212, 'HAROLD & CÂY BÚT PHÉP THUẬT', '2024-08-01', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/08-2024/harold.jpg', 99, 'Phụ Đề', 'Cốt truyện dựa trên bộ truyện cùng tên - được xuất bản vào năm 1955. Cuốn sách của Crockett Johnson kể về Harold, một cậu bé 4 tuổi, với sức mạnh của cây bút chì màu, đã tạo ra thế giới xung quanh mình. Harold sử dụng cây bút chì màu tím kì diệu của mình để vẽ một cánh cửa dẫn vào Thế giới Thực, nơi anh và những người bạn của mình dấn thân vào một cuộc phiêu lưu mới lạ.', 'Carlos Saldanha', 2, '2D', 'https://www.youtube.com/watch?v=enmKrSiy4-M'),
(213, 'JOKER: ĐIÊN CÓ ĐÔI', '2024-10-03', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/10-2024/joker.jpg', 99, 'Phụ Đề', 'Joker: Folie à Deux là phần nối tiếp câu chuyện về Arthur Fleck khi tạo ra một cuộc bạo loạn chưa từng có tại Gotham. Đặc biệt, Lady Gaga sẽ vào vai Harley Quinn, người tình nổi tiếng nhưng cũng không kém phần điên loạn của gã hề Joker.', 'Todd Phillips', 2, '2D', 'https://www.youtube.com/watch?v=uX41hMpfGUU'),
(214, 'LẬT MẶT 7: MỘT ĐIỀU ƯỚC (K)', '2024-04-19', 'K', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/poster-lat-mat-7.jpg', 138, 'VN', 'Một câu chuyện lần đầu được kể bằng tất cả tình yêu, và từ tất cả những hồi ức xao xuyến nhất của đấng sinh thành', 'Lý Hải', 1, '2D', 'https://www.youtube.com/watch?v=xHpgjsgKJzo'),
(215, 'VÂY HÃM: KẺ TRỪNG PHẠT (T18)', '2024-04-25', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/vay-ham-ke-trung-phat.jpg', 125, 'Phụ Đề', 'Siêu cớm Ma Seok-do tái xuất để đối đầu với những tội phạm tinh vi trong giới công nghệ. Nắm đấm trứ danh liệu có phát huy được sức mạnh trước liên minh tội phạm của thiên tài công nghệ và ông trùm nhà cái lớn nhất châu Á?', 'Heo Myeong Haeng', 1, '2D', 'https://www.youtube.com/watch?v=DsFygmpE0k8'),
(216, 'TÀ KHÚC TRIỆU VONG (T18)', '2024-04-25', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/ta-khuc-trieu-vong.jpg', 120, 'Phụ Đề', 'Là tựa phim kinh dị mới gây rúng động bởi điệu múa gọi hồn đậm chất tâm linh chưa từng có, TÀ KHÚC TRIỆU VONG kể về một nữ diễn viên có khả năng thực hiện nghi thức cấm để triệu hồi quỷ dữ. Từ đây,  loạt án mạ.ng bí ẩn liên tiếp ập đến kéo theo những sự kiện kỳ lạ xảy ra tại một ngôi trường bị bỏ hoang.', 'Han Dong Seok', 1, '2D', 'https://www.youtube.com/watch?v='),
(217, 'THẦN BÀI TRỞ LẠI TẤT TAY (T18)', '2024-04-18', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/all-in.jpg', 102, 'Phụ Đề', 'Mang danh thần bài trăm trận trăm thắng, Trình Gia Lãng phát hoảng khi siêu năng lực mắt thần đột nhiên mất vào tay một kẻ gà mờ - Hoàng Tiểu Thất. Từ đây, cả hai phải miễn cưỡng hợp lực hòng chiến thắng vua bài - Vi Nhất Phú và làm lộ ra bí mật động trời...', 'Matt Lai', 1, '2D', 'https://www.youtube.com/watch?v=UkL6dE89Fxo'),
(218, 'B4S - TRƯỚC GIỜ \"YÊU\" (T18)', '2024-04-18', 'T18', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/truoc-gio-yeu-b4s-poster.jpg', 110, 'VN', 'B4S - Trước Giờ \"Yêu\" sẽ bắt đầu bằng một đêm \"nhớ đời\" của hai nhóm bạn thân tại quán bar. Và sau đó, khán giả sẽ được theo dõi câu chuyện tình yêu của từng người trong \"đêm định mệnh\" ấy.', 'Tùng Leo, Michael Thái, Huỳnh Anh Duy', 1, '2D', 'https://www.youtube.com/watch?v=0MWBlIXAtGc'),
(219, 'ANH HÙNG BÀN PHÍM (T16)', '2024-04-18', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/04-2024/anh-hung-ban-phim-poster.jpg', 120, 'Phụ Đề', 'Im Sang-jin - một phóng viên mảng xã hội đã bị đình chỉ công tác sau bài phóng sự điều tra sai lệch về những lùm xùm của tập đoàn Manjun. Tưởng rằng phải chịu nỗi oan ức suốt đời, Im Sang-jin bất ngờ nhận được thông tin ẩn danh khẳng định anh không sai, mà mọi thứ đã bị thao túng bởi một “đội quân” trực tuyến: Chỉ cần có tiền, sự thật nào cũng hoá thành dối lừa, còn tin tức giả lại hoá thành sự thật. Quyết tâm dấn thân vào con đường điều tra “Team Aleph”, Im Sang-jin dần khám phá ra những bí mật động trời khi tiếp xúc với các thành viên chủ chốt của nhóm chuyên gieo rắc tin giả. Thế lực đứng sau các thông tin sai lệch có sức mạnh khủng khiếp đến nhường nào? Liệu Im Sang-jin có thể lật tẩy tất cả và giành chiến thắng giữa ranh giới mong manh của sự thật và dối trá?', 'Ahn Guk Jin', 1, '2D', 'https://www.youtube.com/watch?v=tlpRjjHgZLo');
