(220, 'NẮM ĐẤM TRỜI BAN', '2024-05-02', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/05-2024/nam-dam-troi-ban.jpg', 99, 'Phụ Đề', 'Giang hồ giả Linh Mục, Phật Tử\r\nCớm điên giả Thầy Đồng\r\nHợp tác với nhau đi bắt tội phạm?!\r\n\r\nTeam báng bổ thánh thần này hứa hẹn cho một bộ phim hài hước và châm biếm hết nấc về hành trình tội phạm hoàn lương chốn linh thiêng.', '', 2, '2D', 'https://www.youtube.com/watch?v='),
(221, 'ARTHUR: CHÚ CHÓ KIÊN CƯỜNG', '2024-05-02', 'T13', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/05-2024/arthur-chu-cho-kien-cuong.jpg', 99, 'VN', 'Giữa chặng đua đầy khắc nghiệt kéo dài 5 ngày, đội đua của Michael cùng các đồng đội đã nhận được sự giúp đỡ của chú chó hoang Arthur. Một team hoàn chỉnh được thành lập và tạo nên một chặng đua truyền cảm hứng nhất từ trước tới giờ.', 'Simon Cellan Jones', 2, '2D', 'https://www.youtube.com/watch?v=BDKnUkcaVc4'),
(222, 'PANDA ĐẠI NÁO LÃNH ĐỊA VUA SƯ TỬ (P)', '2024-05-02', 'P', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/05-2024/panda-dai-nao-lanh-dia-vua-su-tu.jpg', 88, 'Lồng Tiếng', 'Để giải cứu rồng con Tiểu Long đang bị bắt cóc sang châu Phi, Gấu trúc Bư quyết định ra đi tìm đường cứu bạn. Trên hành trình của mình, Bư đã khám phá ra một thế giới hoàn toàn xa lạ và phải đối mặt với những con hà mã đáng sợ, những con linh cẩu khôn ngoan và những con khỉ đột chiêu trò. Dựa vào trí thông minh của mình, Bư đã tìm đường băng xuyên châu Phi trước khi giải cứu Tiểu Long và cứu ngôi nhà trong rừng rậm của những người bạn mới trước âm mưu tàn ác của sư tử Malume.', 'KARSTEN KIILERICH', 2, '2D', 'https://www.youtube.com/watch?v=WEUd84Ik3TA'),
(223, 'MỎ VÀNG', '2024-05-02', 'P', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/05-2024/mo-vang.jpg', 99, 'Phụ Đề', '', '', 2, '2D', 'https://www.youtube.com/watch?v=HXneR0oL4YI'),
(224, 'PHIM ĐIỆN ẢNH DORAEMON: NOBITA VÀ BẢN GIAO HƯỞNG ĐỊA CẦU', '2024-05-23', 'P', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/05-2024/doraemon.jpg', 99, 'Phụ Đề', 'Sẽ thế nào nếu thế giới không còn âm nhạc? Mùa hè này, hãy cùng Doraemon và những người bạn bắt đầu cuộc phiêu lưu ngập tràn giai điệu nhé!', 'Kazuaki Imai', 2, '2D', 'https://www.youtube.com/watch?v=-su6eKeETzg'),
(225, 'NGÔI ĐỀN KỲ QUÁI 4 (T16)', '2024-05-30', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/05-2024/ngoi-den-ky-quai-4.jpg', 125, 'VN', 'Hồn ma Nak với sức mạnh khủng khiếp nhất, đáng sợ nhất mà bộ đôi mỏ hỗn Balloon & First phải đối mặt để giải cứu cho trai đẹp Min Joon. Liệu hội bạn này sẽ giải được nghiệp mình tạo ra hay sẽ tan rã từ đây?', 'Phontharis Chotkijsadarsopon', 2, '2D', 'https://www.youtube.com/watch?v=AEH_cOieb7E'),
(226, 'DEADPOOL & WOLVERINE', '2024-07-25', 'T16', 'https://api-website.cinestar.com.vn/media/wysiwyg/Posters/07-2024/deadpool-_-wolverine.jpg', 99, 'Phụ Đề', 'Deadpool 3 sẽ mang đến rất nhiều biến thể khác nhau của Wade Wilson, và không loại trừ khả năng một trong số họ đến từ dòng thời gian chính của MCU. Có không ít tin đồn liên quan đến việc Lady Deadpool cũng sẽ xuất hiện trong bom tấn này và do bà xã của Ryan Reynolds, Blake Lively thủ vai.', 'Shawn Levy', 2, '2D', 'https://www.youtube.com/watch?v='),
(228, 'test ne', '2024-05-07', 'T13', '/public/uploads/663b40971248e.png', 180, 'dfdsfsdf', 'đâsdadad', 'dsds', 1, '3D', '/public/uploads/663b40ab9495f.mp4');
