INSERT INTO `RapChieu` (`MaRapChieu`, `TenRapChieu`, `DiaChi`, `HinhAnh`, `TrangThai`, `MoTa`) VALUES
(1, 'Rạp Quốc Thanh', '271 Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, Thành Phố Hồ Chí Minh', 'https://cinestar-api.monamedia.net/media/wysiwyg/CinemaImage/01-Quoc-Thanh-masthead.jpg', 23, 'CINESTAR QUỐC THANH\nCinestar Quốc Thanh là rạp chiếu phim đầu tiên trong hệ thống Cinestar sở hữu hệ thống âm thanh Dolby Atmos hiện đại nhất.\nVới vị trí đắc địa tại trung tâm Sài Gòn, không gian rộng rãi và thiết kế hiện đại, Cinestar Quốc Thanh là nơi mang đến trải nghiệm giải trí tuyệt vời cho khách hàng mọi lứa tuổi.\nDịch vụ: Cinestar, C’Coffee\nĐịa chỉ: 271 Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, Thành phố Hồ Chí Minh\nHotline: 028 7300 8881\nFacebook: https://www.facebook.com/Cines'),
(2, 'Rạp  Hai Bà Trưng (TP.HCM)', '135 Hai Bà Trưng, Phường Bến Nghé ,Quận 1,Thành Phố Hồ Chí Minh', 'https://cinestar-api.monamedia.net/media/wysiwyg/CinemaImage/03-Hai_Ba_Trung_masthead.jpg', 23, 'Cinestar Hai Bà Trưng nằm tại trung tâm Quận 1, gần nhiều trường đại học, trung tâm văn hóa và thương mại. Với vị trí đắc địa này, Cinestar Hai Bà Trưng là điểm đến giải trí ưa thích của nhiều khán giả trẻ. Với cam kết mang đến những trải nghiệm điện ảnh tuyệt vời nhất cùng giá vé hấp dẫn, Cinestar Hai Bà Trưng là lựa chọn hoàn hảo cho những ai yêu thích phim màn ảnh rộng.\r\nDịch vụ: Cinestar, C’Coffee\r\nĐịa chỉ: 135 Hai Bà Trưng, Phường Bến Nghé, Quận 1, Thành phố Hồ Chí Minh. \r\nHotline:028 7300 '),
(3, 'Rạp Sinh Viên (Bình Dương)', 'Nhà văn hóa sinh viên, Đại học Quốc gia HCM, P.Đông Hòa,Dĩ An,Bình Dương', 'https://cinestar-api.monamedia.net/media/wysiwyg/CinemaImage/05_sinh_vien_masthead.jpg', 23, 'CINESTAR SINH VIÊN (BÌNH DƯƠNG) \r\nCinestar Sinh Viên nằm trong khuôn viên làng đại học quốc gia TPHCM, nơi đang có hơn 76000 sinh viên đang học tập. Cinestar Sinh Viên là điểm đến giải trí không thể thiếu cho khán giả sinh viên và khu dân cư lân cận. Rạp chiếu phim đã tạo ra một cộng đồng đam mê điện ảnh trẻ trung sôi động tại đây.\r\nDịch vụ: Cinestar, C’Coffee\r\nĐịa chỉ: Nhà văn hóa Sinh Viên, ĐHQG Thành phố Hồ Chí Minh, tỉnh Bình Dương.\r\nHotline: 028 7303 8881 \r\nFacebook: https://www.facebook.co'),
(4, 'Rạp Mỹ Tho', '52 Đinh Bộ Lĩnh, Phường 3, Thành phố Mỹ Tho, Tiền Giang', 'https://cinestar-api.monamedia.net/media/wysiwyg/CinemaImage/06_My_Tho_masthead.jpg', 23, 'Cinestar Mỹ Tho được xây dựng mới trên nền nhà hát cải lương Rạp Viễn Trường xưa của Bạch Công Tử, mang không gian ấm áp của văn hóa Nam Bộ nhưng thiết kế rất hiện đại phù hợp với khán giả trẻ và gia đình. Các phòng chiếu phim được trang bị máy móc, màn ảnh và âm thanh tối tân, cùng với khu vui chơi Kidzone dành cho trẻ em và trung tâm C\\\'Billiards sôi động ở tiền sảnh.\r\nDịch vụ: Cinestar, C’Coffee, C’Kidzone, C’Billiards \r\nĐịa chỉ: 52 Đinh Bộ Lĩnh, Phường 3, thành phố Mỹ Tho, tỉnh Tiền Giang.\r\n'),
(5, 'Rạp  Kiên Giang', 'Lô A2 - Khu 2 Trung tâm Thương mại Rạch Sỏi, Đường Nguyễn Chí Thanh, Phường Rạch Sỏi, Thành phố Rạch Giá, Tỉnh Kiên Giang', 'https://cinestar-api.monamedia.net/media/wysiwyg/CinemaImage/07_Kien_Giang_masthead.jpg', 23, 'Cinestar Kiên Giang tọa lạc tại trung tâm văn hóa thương mại lâu đời, sầm uất ở Rạch Sỏi, vùng đất lập nghiệp đầu tiên của người dân Kiên Giang. Rạp chiếu phim được thiết kế hiện đại, trẻ trung với vị trí thuận lợi, phù hợp cho nhiều gia đình và thanh thiếu niên đến xem phim và vui chơi giải trí. Rạp phim mở cửa đến tận khuya cùng với các dịch vụ như quầy hàng cafe C\\\'Coffee phục vụ ăn uống và khu vui chơi Kidzone dành cho trẻ em.\r\nDịch vụ: Cinestar, C’Coffee, C’Kidzone\r\nĐịa chỉ: TTTM Rạch Sỏi, '),
(6, 'Rạp  Lâm Đồng', '713 QL20, Liên Nghĩa, Đức Trọng, Lâm Đồng', 'https://cinestar-api.monamedia.net/media/wysiwyg/CinemaImage/08_Lam_Dong_masthead.jpg', 23, 'Cinestar Lâm Đồng là cụm rạp chiếu phim hiện đại bậc nhất, tọa lạc tại trung tâm văn hóa - thương mại của thành phố Đức Trọng. Với thời tiết dịu mát quanh năm, đây là điểm đến lý tưởng để cùng bạn bè đến xem phim và thư giãn với cốc cà phê trong không gian lãng mạn vào những buổi chiều. Cinestar Lâm Đồng mang đến không gian yên ả, thanh bình, lý tưởng cho buổi hẹn hò như những thước phim.\r\nDịch vụ: Cinestar, C’Coffee, C’Kidzone\r\nĐịa chỉ: Trung tâm thương mại TTC Plaza, 713 QL20, Liên Nghĩa, Đức '),
(7, 'Cinestar Đà Lạt', 'Quảng trường Lâm Viên, P10, TP.Đà Lạt, Lâm Đồng', 'https://cinestar-api.monamedia.net/media/wysiwyg/CinemaImage/02-Da_Lat_masthead.jpg', 23, 'Cinestar Đà Lạt nằm tại Quảng trường Trung tâm thành phố Đà Lạt, với biểu tượng Hoa Dã Quỳ nổi tiếng. Tòa tháp Hoa Dã Quỳ chính là Nhà hát Dalat Opera House và các rạp chiếu phim của Cinestar. Ngoài ra, Cinestar còn vận hành chuỗi Nhà hàng Món Ngon Đà Lạt, khu vui\r\nchơi trẻ em Kidzone, trung tâm C\\\'Billiards và C\\\'Bowling, thu hút hàng ngàn lượt khách đến vui chơi giải trí hàng ngày.\r\nDịch vụ: Cinestar, C’Coffee, C’Kidzone, C’Games, C’Bowling, C’Billiards, C’Gym, Nhà hát Đà Lạt Opera, Nhà hàng m'),
(8, 'Cinestar Huế', '25 Hai Bà Trưng, Vĩnh Ninh, Thành phố Huế, Thừa Thiên Huế', 'https://cinestar-api.monamedia.net/media/wysiwyg/CinemaImage/04_Hue_masthead.jpg', 23, 'Cinestar Huế là tổ hợp rạp chiếu phim và giải trí lớn nhất tại thành phố Huế, nơi tổ chức nhiều hoạt động văn hóa điện ảnh quy mô trong nước và quốc tế. Tọa lạc tại trung tâm Phố Đi Bộ, Cinestar Huế có quy mô phòng chiếu phim lớn với hàng ngàn chỗ ngồi, cùng với chuỗi ẩm thực\r\ngiải trí quy mô như Nhà hàng Món Ngon Huế, khu vui chơi trẻ em Kidzone và trung tâm C\\\'Billiards và C\\\'Bowling.\r\nDOANH NGHIỆP\r\nDịch vụ: Cinestar, C’KidzTone, C’Games, C’Bowling, C’Billiards, Nhà hàng món ngon,C’BEER. \r\nĐịa');
